import './Time.css';

const Time = (props) => {
    return(
        <section className='time' style={{
            backgroundColor: props.corSecundario
        }}>
            <h3 style={
                {
                    borderColor: props.corPrimaria
                }
            }>{props.time}</h3>

        </section>
    );
}

export default Time;
